import{_ as e,c as r,o as a,U as t}from"./chunks/framework.KjOEH70y.js";const b=JSON.parse('{"title":"Troubleshooting JavaScript","description":"JS troubleshooting.","frontmatter":{"title":"Troubleshooting JavaScript","category":"Documentation","mentions":["Herobrine643928","JaylyDev","SmokeyStack","ThomasOrs"],"description":"JS troubleshooting."},"headers":[],"relativePath":"scripting/troubleshooting.md","filePath":"scripting/troubleshooting.md","lastUpdated":1723852445000}'),n={name:"scripting/troubleshooting.md"},o=t(`<p>This article teaches you the basic workflow for debugging any JavaScript issue.</p><h2 id="error-reference" tabindex="-1">Error Reference <a class="header-anchor" href="#error-reference" aria-label="Permalink to &quot;Error Reference&quot;">​</a></h2><p>These errors can be a helpful debugging your code, but the reported problem isn&#39;t always immediately clear. Most of these errors are common in JavaScript engines, so they can be found with a search on a search engine (e.g. Google Search).</p><p>You can learn more about each Error class in <code>MDN</code> by clicking the link below each error names.</p><ul><li><a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/EvalError" target="_blank" rel="noreferrer"><code>EvalError</code></a><ul><li>Creates an instance representing an error that occurs regarding the global function <code>eval()</code>.</li></ul></li><li><a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/RangeError" target="_blank" rel="noreferrer"><code>RangeError</code></a><ul><li>Creates an instance representing an error that occurs when a numeric variable or parameter is outside its valid range.</li></ul></li><li><a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/ReferenceError" target="_blank" rel="noreferrer"><code>ReferenceError</code></a><ul><li>Creates an instance representing an error that occurs when de-referencing an invalid reference. In Minecraft Script Engine, there is a reference error with no clear reason of why this error triggers:</li><li>Native object bound to prototype does not exist.</li></ul></li><li><a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/SyntaxError" target="_blank" rel="noreferrer"><code>SyntaxError</code></a><ul><li>Creates an instance representing a syntax error.</li></ul></li><li><a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/TypeError" target="_blank" rel="noreferrer"><code>TypeError</code></a><ul><li>Creates an instance representing an error that occurs when a variable or parameter is not of a valid type.</li></ul></li><li><a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/URIError" target="_blank" rel="noreferrer"><code>URIError</code></a><ul><li>Creates an instance representing an error that occurs when <code>encodeURI&quot;, &quot;encodeURI()</code> or <code>decodeURI&quot;, &quot;decodeURI()</code> are passed invalid parameters.</li></ul></li><li><a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/AggregateError" target="_blank" rel="noreferrer"><code>AggregateError</code></a><ul><li>Creates an instance representing several errors wrapped in a single error when multiple errors need to be reported by an operation, for example by <code>Promise.any()</code>.</li></ul></li><li><a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/InternalError" target="_blank" rel="noreferrer"><code>InternalError</code></a><ul><li>Creates an instance representing an error that occurs when an internal error in the JavaScript engine is thrown. In Minecraft JS, the errors are the following: <ul><li>stack overflow</li><li>out of memory</li></ul></li></ul></li></ul><h2 id="minecraft-js-errors" tabindex="-1">Minecraft JS Errors <a class="header-anchor" href="#minecraft-js-errors" aria-label="Permalink to &quot;Minecraft JS Errors&quot;">​</a></h2><p>Since Minecraft Bedrock Edition uses a their own version of JavaScript, which is based on QuickJS, there are some errors that only exist in Minecraft and these errors are quite common since the API is built on native C++.</p><h3 id="internalerror-out-of-memory" tabindex="-1">InternalError: out of memory <a class="header-anchor" href="#internalerror-out-of-memory" aria-label="Permalink to &quot;InternalError: out of memory&quot;">​</a></h3><p>This error occurs when the combined memory usage exceeds 250 megabytes.</p><p>This saves and shuts down the world by Watchdog termination and cannot be canceled using <code>BeforeWatchdogTerminateEvent</code>.</p><p>The memory limit can be adjusted in <code>server.properties</code> by modifying <code>script-watchdog-memory-limit</code>. (Setting this value to 0 disables the limit.)</p><h3 id="internalerror-stack-overflow" tabindex="-1">InternalError: stack overflow <a class="header-anchor" href="#internalerror-stack-overflow" aria-label="Permalink to &quot;InternalError: stack overflow&quot;">​</a></h3><p>Occurs when there is a recursive function (a function that calls itself) without an exit point.</p><p>Example code:</p><div class="language-js vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">js</span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">function</span><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;"> loop</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">(</span><span style="--shiki-light:#E36209;--shiki-dark:#FFAB70;">x</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">) {</span></span>
<span class="line"><span style="--shiki-light:#6A737D;--shiki-dark:#6A737D;">  // The base case is missing</span></span>
<span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">  loop</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">(x </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">+</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> 1</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">); </span><span style="--shiki-light:#6A737D;--shiki-dark:#6A737D;">// Recursive call</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">}</span></span>
<span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">loop</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">(</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">0</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">);</span></span>
<span class="line"><span style="--shiki-light:#6A737D;--shiki-dark:#6A737D;">// InternalError: stack overflow</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br><span class="line-number">6</span><br></div></div><h3 id="internalerror-interrupted" tabindex="-1">InternalError: interrupted <a class="header-anchor" href="#internalerror-interrupted" aria-label="Permalink to &quot;InternalError: interrupted&quot;">​</a></h3><p>Occurs when runtime has a negligible cost. This happens depend on how your script is setup.</p><h3 id="typeerror-no-setter-for-property" tabindex="-1">TypeError: no setter for property <a class="header-anchor" href="#typeerror-no-setter-for-property" aria-label="Permalink to &quot;TypeError: no setter for property&quot;">​</a></h3><p>This occurs when trying to set a new value to a property, for which only a getter is defined.</p><p>This is common when attempting to set property on native objects from native modules.</p><h3 id="typeerror-value-is-not-iterable" tabindex="-1">TypeError: value is not iterable <a class="header-anchor" href="#typeerror-value-is-not-iterable" aria-label="Permalink to &quot;TypeError: value is not iterable&quot;">​</a></h3><p>This occurs when an iteration happens over a value that is not an iterable object.</p><p>Click <a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Errors/is_not_iterable" target="_blank" rel="noreferrer"><strong>here</strong></a> for more information.</p><h3 id="typeerror-not-a-function" tabindex="-1">TypeError: not a function <a class="header-anchor" href="#typeerror-not-a-function" aria-label="Permalink to &quot;TypeError: not a function&quot;">​</a></h3><p>This occurs when there was an attempt to call a value from a function, but the value is not actually a function. This is very common as script API constantly remove or rename methods without mentioning them in Minecraft changelog.</p><p>Click <a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Errors/Not_a_function" target="_blank" rel="noreferrer"><strong>here</strong></a> for more information.</p><h3 id="typeerror-native-type-conversion-failed" tabindex="-1">TypeError: Native Type Conversion Failed <a class="header-anchor" href="#typeerror-native-type-conversion-failed" aria-label="Permalink to &quot;TypeError: Native Type Conversion Failed&quot;">​</a></h3><p>This error occurs when you input the wrong type of value into a required parameter in a native method.</p><h3 id="typeerror-native-variant-type-conversion-failed" tabindex="-1">TypeError: Native Variant Type Conversion Failed <a class="header-anchor" href="#typeerror-native-variant-type-conversion-failed" aria-label="Permalink to &quot;TypeError: Native Variant Type Conversion Failed&quot;">​</a></h3><p>This error occurs when you input the wrong type of value into an optional parameter in a native method.</p><h3 id="typeerror-object-did-not-have-a-native-handle" tabindex="-1">TypeError: Object did not have a native handle <a class="header-anchor" href="#typeerror-object-did-not-have-a-native-handle" aria-label="Permalink to &quot;TypeError: Object did not have a native handle&quot;">​</a></h3><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>This error is not documented publicly, so the explanation is an estimate.</p></div><p>The error throws when the script tries to fetch a native handle from a JavaScript object, but the handle instance was cleared.</p><h3 id="referenceerror-native-object-bound-to-prototype-does-not-exist" tabindex="-1">ReferenceError: Native object bound to prototype does not exist. <a class="header-anchor" href="#referenceerror-native-object-bound-to-prototype-does-not-exist" aria-label="Permalink to &quot;ReferenceError: Native object bound to prototype does not exist.&quot;">​</a></h3><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>This error is not documented publicly, so the explanation is an estimate.</p></div><p>This error throws when a method is not supported by native codebase due to unexpected reasons. In some circumstances restarting the game should fix the issue.</p><h2 id="debugging" tabindex="-1">Debugging <a class="header-anchor" href="#debugging" aria-label="Permalink to &quot;Debugging&quot;">​</a></h2><p>Debugging allows you to find the exact point where you made a mistake on your JavaScript code. Minecraft has a built-in JavaScript debugger which you can enable by turning on Content Log GUI located in <code>Settings &gt; Creator</code>.</p><h3 id="logging-level" tabindex="-1">Logging level <a class="header-anchor" href="#logging-level" aria-label="Permalink to &quot;Logging level&quot;">​</a></h3><ul><li><p><strong>[Scripting][Inform]</strong></p><p>you can use <code>console.log()</code> or <code>console.info()</code> to display JavaScript values, however they are only displayed in <a href="/guide/troubleshooting.html#content-log-file">Content Log file</a>, which you can see them <a href="/guide/troubleshooting.html#content-log-file">here</a>.</p><p><code>00:00:00-[Scripting][Inform]-</code>: This text is triggered when <code>console.log()</code> or <code>console.info()</code> is used.</p></li><li><p><strong>[Scripting][Warning]</strong></p><p>This outputs a warning message in both Content Log GUI and Content log file. The following text is displayed when the function is triggered.</p><p><code>00:00:00-[Scripting][Warning]-</code>: This text is triggered when <code>console.warn()</code> is used.</p></li><li><p><strong>[Scripting][Error]</strong></p><p>This outputs an error message in both Content Log GUI and Content log file. The following text is displayed when the function is triggered.</p><p><code>00:00:00-[Scripting][Error]-</code>: This text is triggered when <code>console.error()</code> is used.</p></li></ul><h3 id="stack-trace" tabindex="-1">Stack trace <a class="header-anchor" href="#stack-trace" aria-label="Permalink to &quot;Stack trace&quot;">​</a></h3><p>A stack trace is a list of the functions, in order, that lead to a breakpoint in a software program.</p><p>This is useful to find the cause of the problem in your code.</p><p>Example:</p><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>[Scripting][error]-SyntaxError: unexpected character</span></span>
<span class="line"><span>    at &lt;anonymous&gt; (index.js:16)</span></span>
<span class="line"><span>    at parse (native)</span></span>
<span class="line"><span>    at r (bundle.js)</span></span>
<span class="line"><span>    at &lt;anonymous&gt; (bundle.js)</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br><span class="line-number">5</span><br></div></div><ul><li>Error name: SyntaxError</li><li>Error message: unexpected character</li><li>Where the error cause: line 16 in file <code>index.js</code></li></ul><hr><p><a href="https://github.com/JaylyDev/ScriptAPI/blob/main/docs/JavaScript/Error.md" target="_blank" rel="noreferrer">Original Credit</a></p>`,48),i=[o];function s(l,c,p,h,d,u){return a(),r("div",null,i)}const m=e(n,[["render",s]]);export{b as __pageData,m as default};
